  false,\n\t\"url\": null,\n\t\"notes\": \"This report presents preliminary reconnaissance
  data on sediment and fish samples collected within the Great Swamp National Wildlife
  Refuge (GSNWR) Tract 141A - the former Hidden Valley Nursery (HVN) and on GSNWR
  Tract 354. Tract 354 is juxtaposed and down gradient of a currently active nursery
  operation, the Great Swamp Greenhouses (GSGH). As sediment and biota samples collected
  only represent a few data points, caution should be taken by the reader as to not
  misconstrue this report as either an ecological risk assessment or site characterization/delineation
  report. The purpose of this report to present preliminary reconnaissance data so
  that land managers can make better informed resource allocations decisions that
  address, among other things, the numerous landscape level contaminant-related issues
  facing the refuge today and in the future.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
